import React, { useState } from 'react';
import Login from './Login';
import Signup from './Signup';

function App() {
  const [showLogin, setShowLogin] = useState(true);

  return (
    <div>
      {showLogin ? 
        <Login switchToSignup={() => setShowLogin(false)} /> : 
        <Signup switchToLogin={() => setShowLogin(true)} />
      }
    </div>
  );
}

export default App;
